import React from 'react'
import styled from 'styled-components'

const Pay = () => {
   const Container = styled.div`
          height: 100vh;
          display: flex;
          justify-content: center;
          align-items: center;
   `
   const Button = styled.button`
         width: 30px;
          padding: 15px;
          background-color: #000;
          color: #fff;
          border-radius: 8px;
          border: none;

   `

  return (
    <Container>
        <Button>Pay</Button>
    </Container>
  )
}

export default Pay
